import React from "react";
import {TouchableOpacity, Text, StyleSheet, TouchableOpacityProps, View} from 'react-native'

interface ISkillCaraProps extends TouchableOpacityProps {
    Codigo: string,
    Pais: string,

}

export function SkillCard({Codigo, Pais, ...rest}: ISkillCaraProps){
    return (
        <TouchableOpacity
            style={styles.viewGeral} 
            
        >
        <View style={styles.infoPais}>
           <Text style={styles.textCodigo}>
        
            {Codigo}
            </Text>
            <Text style={styles.textPais}>
                
            {Pais}
            </Text>
        </View>

            <TouchableOpacity style={styles.buttonStyle}
            {...rest} >
                <Text style={styles.buttonText}>
                    Remover País
                </Text>
                
            </TouchableOpacity>
            
       </TouchableOpacity>

        
       
        
    )
}
const styles = StyleSheet.create({
    viewGeral: {
        
        flexDirection: 'row',
        alignItems: 'center',
        
    },

    infoPais: {
        backgroundColor: '#ffffff81',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent:'center',
        textAlign:'center',
        width: '80%',
    },

    textCodigo: {
        color: '#fff',
        fontSize: 30,
        fontWeight: 'bold',
        width: '50%',
        borderWidth: 2,
       
        
    },
    textPais: {
        color: '#fff',
        fontSize: 30,
        fontWeight: 'bold',
        width: '50%',
        borderWidth: 2
        
    },
    buttonText: {
        color: '#fff',
        fontSize: 30,
        fontWeight: 'bold',
        
        
    },
    buttonStyle: {
        backgroundColor: '#ffffff81',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent:'center',
        width: '20%',
        borderWidth: 2
    }
})
